import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class register extends Component {
    constructor() {
        super();
        this.state = {}
    }
  add=()=>{
        this.props.history.go(-1)
  }
    render() {
        return (<Fragment>
            <div className={"register"}>
             <div className={"one"}>
            <span onClick={this.add}>取消</span>
                 <p>手机验证</p>
             </div>
                <div className={"two"}>
                    <div><p dangerouslySetInnerHTML={{ __html: d.areaName}}>请验证你的手机验证码，确认是本人操作
                        <br/> &npsp;&npsp;&npsp;&npsp;&npsp;&npsp;&npsp;后，再进行修改密码</p></div>
                    <div>
                        <select className={"select"}>
                            <option className={"phoneop"}>86</option>
                        </select>
                            <input ref={"input"}  placeholder={"请输入手机号"} onBlur={this.add}/>
                    </div>
                </div>
                <div className={"one"}>

                </div>
                </div>
        </Fragment>)
    }

}

export default withRouter(register);
